import React from 'react';
import ReactDOM from 'react-dom';

let object = {
  avatarUrl: "https://www.w3schools.com/js/js_object_properties.asp",
  author: "Seytech",
  text:"Some text",
  date: "12/08/2010"
}

const UserInfoName = (props) => <div>{props.text}</div>;
const Avatar       = (props) => <img src="{props.author.avatarUrl}"></img>;


const UserInfo = () => <div><Avatar img={object.avatarUrl}/>,<UserInfoName name={object.author}/></div>;
const Comment = () => <div><UserInfo/></div>;

const App = () => (
                <div>
                  <Comment/>
                </div>
              );


ReactDOM.render(
  <App/>,
  document.getElementById('root')

);







